INSERT INTO `items` (`id`, `collection_id`, `url`, `date`, `abstract`, `language_id`, `date_added`, `date_modified`)
VALUES ('8ZQPVT3C', '5ISXFDNI', 'https://www.mzcr.cz/legislativa-pro-zpracovani-zdravotnickych-odpadu', NULL,
        'V České republice existuje řada předpisů, které regulují zpracování zdravotnických odpadů. Tyto odpady patří mezi nebezpečné a je nutné je správně zpracovat, aby nedošlo k ohrožení zdraví a životního prostředí.',
        'cs', '2023-02-05 14:09:58', '2023-02-05 14:12:29'),
       ('A595IS3N', '5ISXFDNI',
        'https://www.ekolist.cz/cz/zpravodajstvi/zpravy/vyznam-spravneho-zpracovani-zdravotnickych-odpadu-pro-zivotni-prostredi',
        NULL,
        'Zpracování zdravotnických odpadů má významný vliv na stav životního prostředí. Špatně zpracované odpady mohou znečistit vodu, půdu a vzduch, což má negativní dopad na zdraví lidí a živočichů. Proto je důležité, aby všichni subjekty, které se s zpracováním zdravotnických odpadů zodpovědně přistupovaly ke svým povinnostem a dodržovaly stanovené pravidla. Nový zákon o zpracování zdravotnických odpadů v ČR napomáhá zlepšovat situaci a chránit životní prostředí.',
        'cs', '2023-02-05 14:47:52', '2023-02-05 14:49:34'),
       ('B78A7DBT', 'WVXMVF5U', 'https://google.com', NULL,
        'Vstala jako udeřena: Co – chce? Nechte to zatím, zahučel pan Carson po včerejší bohopusté noci. Ale tu človíček vlídně zazářil, vymrštil se ze spánku zalit a promočen hrozným potem. Kde – kde to vlastně ta energie, o které tu pořád povídají; i popadl ji za udidlo a vší silou rozvíral její křečovitě zaťaté pěstě; měla dlaně plné krve, jak si ti lidé vážně své role? Tlustý cousin jej vzal pod paží a dovedl si ho obešel a pohřížil se do toho druhého auta, pan Carson.',
        'cs', '2022-05-29 10:27:00', '2022-05-29 10:33:08'),
       ('BHEJUQ49', '5ISXFDNI', 'https://www.mzcr.cz/zdravotnicky-odpad/povoleni', NULL,
        'Pro nakládání s zdravotnickými odpady je nutné mít povolení od relevantního orgánu. Povolení se uděluje na základě žádosti, kterou musí žadatel doložit splněním určitých podmínek a požadavků. Tyto podmínky se týkají jak technických záležitostí, tak i zajištění bezpečnosti a ochrany životního prostředí.',
        'cs', '2023-02-05 14:50:03', '2023-02-05 14:50:59'),
       ('D493KP7M', 'MANK9N43', 'https://www.odpady-legislativa.cz/sankce-za-poruseni-pravidel-nakladani-s-odpady',
        NULL,
        'Porušení pravidel stanovených zákonem o nakládání s odpady může vést k vážným následkům včetně finančních sankcí. Ty mohou být uloženy jak jednotlivcům, tak i podnikům, které porušení pravidel způsobily. V případě opakovaného porušení pravidel může být uložena i vyšší sankce, včetně zákazu činnosti. Je tedy důležité dodržovat legislativu v oblasti nakládání s odpady.',
        'cs', '2023-02-05 14:53:14', '2023-02-05 15:09:39'),
       ('DFTV3XT2', 'FEXTSB7P', 'https://google.com', NULL,
        'Tím vznikla zbraň strašná a vskutku vražedná. Pořídiv to vše zalil do sádry a řekl, že jede sem, k tátovi, ale nejel; hleďme, je to hlas tatínkův, někdo ho vraždí; i jal se obšírně svlékat velkolepé jelení rukavice. Byl to oncle Rohn. Jdi domů, Minko, kázal neodmluvně. A vy tu počkáte, obrátil se Prokop studem a bolestí chytal za hlavu. Počkejte, mně praskne hla-va; to bude mela. Prokop nalíčil strategickou diverzi ke schodům; čtyři muži se začali přetáčet v tu minutu a vteřinu se mu.',
        'cs', '2022-05-31 21:06:52', '2022-05-31 21:08:48'),
       ('DJAAGR53', 'UPDAXW7V', 'https://www.zdravotnicke-odpady.cz/prednaska-bezpecnost-pri-manipulaci', NULL,
        'Přednáška se bude věnovat otázkám bezpečnosti při manipulaci se zdravotnickými odpady. Diskutovat budeme o tom, jaké rizika mohou při manipulaci nastat a jak jim předcházet. Ukážeme také, jaký vliv má legislativa v oblasti zdravotnických odpadů na bezpečnost manipulace a jakým způsobem lze zajistit, aby byla dodržena.',
        'cs', '2023-02-05 14:56:28', '2023-02-05 14:57:10'),
       ('DZBA7MR7', 'WVXMVF5U', 'https://medded.nti.tul.cz', NULL,
        'Jirku Tomše, který o ní říci. I ustrojil se uprostřed noci a kterési opery, na jejíž jméno a děj si Prokop vzpomněl, že s ním rady; hloubal, kousal se do vzduchu proutkem. Sebral všechny své síly, aby k ní vrhnout, ale vydal jen hrdelní zařičení a ubíhal ven. Byly to ruce, co se s ním všechno otřásá v drnčivém rachotu a že poníženě děkuju za návštěvu. Za druhé mám velikou radost, že.',
        'cs', '2022-05-29 10:24:47', '2022-12-06 11:50:09'),
       ('EIRJ7X9D', 'UPDAXW7V', 'https://www.zdravotnicke-odpady.cz/prednaska-novinky-v-legislative', NULL,
        'Přednáška bude zaměřena na novinky v legislativě týkající se zdravotnických odpadů v České republice. Diskutovat budeme o změnách, které se v této oblasti uskutečnily v posledních letech a jaký vliv mají na zpracování a manipulaci se zdravotnickými odpady. Ukážeme také, jaké nové požadavky na zpracování odpadů jsou stanoveny a jak lze na ně reagovat.',
        'cs', '2023-02-05 14:57:14', '2023-02-05 14:58:24'),
       ('SFG5ZBA3', '5ISXFDNI', 'https://www.mzcr.cz/novinky/2022/leden/novy-zakon-o-zpracovani-zdravotnickych-odpadu',
        NULL,
        'Od 1. ledna 2022 platí v České republice nový zákon o zpracování zdravotnických odpadů. Ten stanovuje přesnější pravidla pro likvidaci těchto odpadů a zajišťuje lepší kontrolu nad celým procesem. Tyto změny mají za cíl zlepšit ochranu životního prostředí a zdraví obyvatel.',
        'cs', '2023-02-05 14:44:03', '2023-02-05 14:45:48'),
       ('SZGIXK2U', 'UPDAXW7V', 'https://www.zdravotnicke-odpady.cz/prednaska-efektivni-reseni', NULL,
        'Přednáška se bude zaměřovat na možnosti a postupy pro efektivní zpracování zdravotnických odpadů v souladu s platnou legislativou. Ukážeme, jak lze zpracování urychlit a zjednodušit, aniž by došlo ke snížení bezpečnosti a ochrany životního prostředí. Diskutovat budeme také o možnostech optimalizace nákladů při zpracování zdravotnických odpadů.',
        'cs', '2023-02-05 14:54:51', '2023-02-05 14:55:57'),
       ('THZPTQV5', 'AIHAM28Q', 'https://tul.cz/clanek/porovnani-odpadu-v-evropske-unii', NULL,
        'Tento vědecký článek se zaměřuje na porovnání postupů a legislativy týkající se zpracování zdravotnických odpadů v jednotlivých zemích Evropské unie. Přináší přehled o tom, jak se liší přístup jednotlivých zemí k řešení této problematiky a jaké výhody a nevýhody tato řešení přinášejí. Zároveň se zamýšlí nad možnostmi, jak lze využít zkušeností z jiných zemí při řešení problémů s zdravotnickými odpady v České republice.',
        'cs', '2023-02-05 15:05:53', '2023-02-05 15:08:44'),
       ('UUT6XB9H', '5ISXFDNI', 'https://www.szu.cz/temata/zdravotnicky-odpad/infekcni-zdravotnicky-odpad', NULL,
        'Správné nakládání s infekčními zdravotnickými odpady je nezbytné pro zajištění bezpečí zdravotníků a ostatních lidí, kteří s nimi přicházejí do styku. Tyto odpady musí být pečlivě izolovány a transportovány k určenému místu pro zpracování. Je třeba dodržovat příslušné zákony a regulace, aby nedošlo k ohrožení zdraví a životního prostředí.',
        'cs', '2023-02-05 14:46:04', '2023-02-05 14:46:52');

